import Row from "./Row";
import { render } from "react-dom";

export default function Table({ items, renderHeader }) {
  return (
    <table>
      {renderHeader()}
      <tbody>
        {items.map(item => (
          <Row human={item} key={item.id} />
        ))}
      </tbody>
    </table>
  );
}
